import React, { useState } from "react";
import { AiOutlineClose, AiOutlineMenu } from "react-icons/ai";
import { useNavigate } from "react-router-dom";
const Navbar = () => {
  const [nav, setNav] = useState(false);

  const handleNav = () => {
    setNav(!nav);
   
  };
  const navigate = useNavigate();
  return (
    <div className="z-10 text-gray-500 flex justify-between items-center max-w-[1240px] mx-auto h-24 px-4 text-l">
      <h1 className=" text-3xl font-bold primary-color ml-4">MACOY V.</h1>
      <ul className="hidden md:flex">
        <li className="p-5">Home</li>
        <li className="p-5">Skills</li>
        <li className="p-5">Projects</li>
        <li className="p-5">Gallery</li>
        <li className="p-5">Contact</li>
        <li className="p-5"><span className="cursor-pointer" onClick={() => navigate("/")}>Logout</span></li>
      </ul>

      <div onClick={handleNav} className="block md:hidden">
        {nav ? <AiOutlineClose size={20} /> : <AiOutlineMenu size={20} />}
      </div>

      <div
        className={
          nav
            ? "text-gray-300 fixed h-full left-0 top-0 w[60%] border-r border-r-gray-900 bg-[#202121] ease-in-out duration-500"
            : "fixed left-[-100%]"
        }
      >
        <h1 className=" text-3xl primary-color m-4">MACOY V.</h1>
        <ul className="p-8 text-2xl">
          <li className="p-2">Home</li>
          <li className="p-2">Skills</li>
          <li className="p-2">Projects</li>
          <li className="p-2">Gallery</li>
          <li className="p-2">Contact</li>
          <li className="p-5"><span  onClick={() => navigate("/")}>Logout</span></li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
